import React from 'react';
import { BottomNavigationAction } from '@material-ui/core';

function FavorIcon(props) {
    return (
        <div>
         <img src="data:image/png;base64," 
         id="FaIcon" alt=""
         />
        </div>
    );
}

export default FavorIcon;
